import React from "react";
// import logo from './logo.svg';
import "./App.css";
import { Weather } from "./Weather";

function App() {
  const timex = new Date().toLocaleString;
  const timey = new Date().toLocaleDateString();

  return (
    <div className="App">
      <h1> Welcome </h1>
      <h3>{timex}</h3> - {timey}
      <Weather />
    </div>
  );
}

export default App;
